import React from "react";
import { Link } from 'react-router-dom';


export default function Nav({LinkArray}) {
    return (
        <nav>
            <ul>
                {LinkArray.map(link =><li>
                <Link to={link.path} key= {link.id}>{link.label}</Link></li>)}
            </ul>
        </nav >
              
    );
}
